CREATE TABLE `dico_titre` (
  `id` smallint(5) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Clé unique',
  `cote` varchar(32) DEFAULT NULL COMMENT 'Cote du dictionnaire',
  `nom` varchar(255) NOT NULL COMMENT 'Nom court du dictionnaire, affichable',
  `annee` smallint(6) unsigned NOT NULL COMMENT 'Date de parution du premier volume (clé de tri)',
  `import_ordre` smallint(5) unsigned DEFAULT NULL COMMENT 'Numéro d’ordre pour l’import (priorité aux vedettes récentes et relus)',
  `vols` smallint(6) NOT NULL DEFAULT '1' COMMENT 'Nombre de volumes',
  `pages` mediumint(9) DEFAULT NULL,
  `entrees` mediumint(9) DEFAULT NULL,
  `nomdate` varchar(255) DEFAULT NULL,
  `an_max` smallint(6) unsigned DEFAULT NULL COMMENT 'Date de parution du dernier volume si plusieurs sur plusieurs années',
  `class` varchar(255) DEFAULT NULL,
  `orth_langue` char(3) DEFAULT NULL COMMENT 'Code de langue des vedettes si différentes du français (la, grc), 1 cas "fr,la" pharma_019128',
  `entry_langue` char(3) DEFAULT NULL COMMENT 'Code langue des artciles si différent du français (James en, la)',
  `sep` varchar(10) DEFAULT NULL COMMENT 'Séparateur de vedettes, utilisé par le code d’import, en général, "/", ".", ou cas plus particuliers.',
  `vol_re` varchar(255) DEFAULT NULL,
  `bibl` text COMMENT 'Ligne bibliographique ISBD pour le titre.',
  `livanc` int(10) unsigned DEFAULT NULL COMMENT 'Clé de la cote dans livanc',
  PRIMARY KEY (`id`),
  KEY `livanc` (`livanc`),
  KEY `import` (`import_ordre`,`annee`)
) ENGINE=MyISAM AUTO_INCREMENT=69 DEFAULT CHARSET=utf8 COMMENT='Table des titres des dictionnaires (pouvant concerner plusieurs volumes),  avec informations spéciales dico';
